IMPORTANT, indent what's insde braces or it will fail (parsing error). If tabs fail, add a couple of whitespaces instead IMPORTANT, if wpa_supplicant is connected via an interface to a network it cannot connect to another, search ps aux for wpa_supplicant processes and kill them before connecting to another network or with a different configuration several interfaces of wpa_supplicant can be run in parallel for different interfaces with different configurations scan_ssid -> send probe requests Config file for open network network={ ssid="<ESSID>" scan_ssid=1
} alternative: network={ ssid="<ESSID>" scan_ssid=1 mode=0 auth_alg=OPEN key_mgmt=NONE
} Config file for WEP network If we have a hex key, dont use quotation marks " and don't use : to separate bytes (the next two examples are equivalent, one with ASCII key and the other with hex key) network={ ssid="<ESSID>" key_mgmt=NONE wep_key0="34567" wep_tx_keyidx=0
} network={ ssid="<ESSID>" key_mgmt=NONE wep_key0=0304050607 wep_tx_keyidx=0
} alternative network={ ssid="<ESSID>" scan_ssid=1 mode=0 auth_alg=OPEN key_mgmt=NONE wep_key0=0304050607
} Config file for WPA-PSK network Valid for WPA-PSK and WPA2-PSK network={ ssid="<ESSID>" scan_ssid=1 psk="<passphrase>" key_mgmt=WPA-PSK
} alternative network={ ssid="<ESSID>" mode=0 scan_ssid=1 auth_alg=OPEN key_mgmt=WPA-PSK proto=WPA pairwise=TKIP group=TKIP psk="<passphrase>" } Specific config file for WPA2-PSK but WPA2-PSK (only) can be specified like this also: wpa_supplicant will automatically choose between TKIP and CCMP based on availability, but it is possible to force one or the other by adding pairwise=CCMP or pairwise=TKIP to the configuration if necessary. network={ ssid="<ESSID>" key_mgmt=WPA_PSK psk="<passphrase>" proto=RSN pairwise=CCMP group=CCMP
} # less specific, can work better
network={ ssid="<ESSID>" key_mgmt=WPA_PSK psk="<passphrase>" proto=RSN
} # or maybe this is necessary, due to retrocompatibility with old devices
network={ ssid="<ESSID>" key_mgmt=WPA_PSK psk="<passphrase>" proto=WPA pairwise=CCMP group=CCMP
} RSN -> Robust Secure Network (this sets pairwise and group to CCMP, although it can be specified explicitely so that we are not downgraded in any case). Maybe specifying pairwise and/or group fails, don't specify them first alternative: network={ ssid="<ESSID>" scan_ssid=1 mode=0 auth_alg=OPEN key_mgmt=WPA_PSK psk="<passphrase>" proto=RSN pairwise=CCMP group=CCMP
} WPA-Enterprise PEAP-MSCHAPv2 authentication network={ ssid="<ESSID>" scan_ssid=1 key_mgmt=WPA-EAP eap=PEAP identity="bob" password="hello" phase1="peaplabel=0" phase2="auth=MSCHAPV2"
} PEAP-GTC WPA Supplicant Configuration network={ ssid="<ESSID>" scan_ssid=1 key_mgmt=WPA-EAP eap=PEAP identity="bob" password="hello" phase1="peaplabel=0" phase2="auth=GTC"
} TTLS-PAP WPA Supplicant Configuration network={ ssid="<ESSID>" scan_ssid=1 key_mgmt=WPA-EAP eap=TTLS identity="bob" anonymous_identity="anon" password="hello" phase2="auth=PAP"
} TTLS-CHAP WPA Supplicant Configuration network={ ssid="<ESSID>" scan_ssid=1 key_mgmt=WPA-EAP eap=TTLS identity="bob" anonymous_identity="anon" password="hello" phase2="auth=CHAP"
} TTLS-MSCHAPv2 WPA Supplicant Configuration network={ ssid="<ESSID>" scan_ssid=1 key_mgmt=WPA-EAP eap=TTLS identity="bob" anonymous_identity="anon" password="hello" phase2="auth=MSCHAPV2"
} Tool to generate configuration files: wpa_passphrase. Mandatory parameter: ESSID. Optional parameter: passphrase Connect to a network with wpa_supplicant and config file -i -> interface used to connect -c -> config file -B -> run wpa_supplicant in the background sudo wpa_supplicant -i wlan0 -c wifi-client.conf # sometimes the driver that wpa_supplican uses is specified (different from the driver used for the wifi interface)
sudo wpa_supplicant -Dnl80211 -i wlan0 -c wifi-client.conf # request an ip by dhcp, once we are connected to an AP
dhclient -v wlan0
